import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter} from 'react-router-dom';
import './index.css';
import Home from './Home'
import App from "./App"

ReactDOM.render(
  <BrowserRouter>
  <App/>
  <Home/>
  </BrowserRouter>,
  document.getElementById('root')
);
